    YOW += y[50]*imw[50]; /*C3H8 */
    YOW += y[51]*imw[51]; /*CH2CHO */
    YOW += y[52]*imw[52]; /*CH3CHO */
    /*PW/RT (see Eq. 7) */
    PWORT = (*P)/(YOW * 8.31446261815324e+07 * (*T)); 
    /*multiply by 1e6 so c goes to SI */
    PWORT *= 1e6; 
    /*Now compute conversion (and go to SI) */
    c[0] = PWORT * y[0]*imw[0]; 
