/* Finalizes parameter database */
void CKFINALIZE()
{
  for (int i=0; i<325; ++i) {
    free(TB[i]); TB[i] = 0; 
    free(TBid[i]); TBid[i] = 0;
    nTB[i] = 0;
  }
}

